def write_txt(name, msg,write_type = 'a'):
    if platform.system() == "Windows":
        path = 'C:\\JurassicParkStarter\\'
    if platform.system() == "Darwin":
        path = '/Users/Shared/JurassicParkStarter/'
    try:
        os.makedirs(path)
    except:
        pass
    full_path = path+name+'.txt'
    file = open(full_path, write_type)
    file.write(msg)
def read_txt(name):
    if platform.system() == "Windows":
        path = 'C:\\JurassicParkStarter\\'
    if platform.system() == "Darwin":
        path = '/Users/Shared/JurassicParkStarter/'
    try:
        os.makedirs(path)
    except:
        pass
    full_path = path+name+'.txt'
    file = open(full_path, 'r')
    return file.read()
