def draw_rect(pos,width,height,lenth,color):
    x = pos[0]
    y = pos[1]
    rect = pygame.Rect(x,y,width,height)
    pygame.draw.rect(screen,color,rect,lenth)
def sdpygame(word,wordx,wordy,endx,color,size = 40):
    x4 = wordx
    width = 0
    # num = "1234567890!@#$%^&*()¥qwertyuiopasdfghjklzxcvbnmQWERTYUIOPASDFGHJKLZXCVBNM°"
    lenth = int((endx-wordx)/size)+1
    for i in range(0,len(word),lenth):
        screen.blit(pygame.font.SysFont(FONTNAME,size).render(word[i:i+lenth],True,color),(x4,wordy))
        wordy = wordy+size
        width+=size
        # pygame.display.update()
    return width
    
