class DNA():
    def __init__(self):
        self.image = dnaimg
        self.type = 0
        self.mousepos = (0,0)
    def show(self,word):
        width = sdpygame(word,self.mousepos[0]+40,self.mousepos[1],self.mousepos[0]+170,(255,255,255),20)
        if width<=100:
            width = 105
        arect = pygame.Surface((195,width))
        arect.set_alpha(100)
        arect.fill((0,0,255))
        screen.blit(arect,self.mousepos)
        screen.blit(self.image,self.mousepos)
        width = sdpygame(word,self.mousepos[0]+40,self.mousepos[1],self.mousepos[0]+170,(255,255,255),20)
