    def dil_skill(self):
        self.venomrect.y = self.rect.y+30
        if self.venomrect_type == 1:
            # self.skill_type = 1
            if self.venom_luanch_type == 1:
                self.venomrect.x = self.rect.x
                self.venom_luanch_type = 0
            if self.play_type == 1:
                while not self.venomrect.colliderect(player2.rect):
                    self.venomrect.x+=5
                    if self.venomrect.x>1280:
                        self.skill_type = 0
                        break
                if self.venomrect.colliderect(player2.rect):
                    self.venomrect_type = 0
                    self.skill_type = 0
                    player2.hp -= 1
                    player2.rect.x += 10
            if self.play_type == 2:
                while not self.venomrect.colliderect(player1.rect):
                    self.venomrect.x-=5
                    if self.venomrect.x<0:
                        self.skill_type = 0
                        break
                if self.venomrect.colliderect(player1.rect):
                    self.venomrect_type = 0
                    self.skill_type = 0
                    player1.hp -= 1
                    player1.rect.x -= 10
